import info from './ProfileInfo.module.css';
import Preloader from "../../preloader/Preloader";

function ProfileInfo(props) {
    if(!props.profile) {
        return <Preloader />
    }
    return (
        <div>
            <div>
                <img className={info.bg_image}
                     src={"https://flytothesky.ru/wp-content/uploads/2012/10/midnight-sun-in-lofoten-norway.jpg"} alt={'img'}/>
            </div>
            <div className={info.descriptionBlock}>
                <div className={info.profile_name}>{props.profile.fullName}</div>
                <img className={info.profile_avatar} src={props.profile.photos.large} alt={'avatar'} />
                <div>About me: <span className={info.desc_txt}>{props.profile.aboutMe}</span> </div>
                <div className={info.profile_job}>Job: <span className={info.desc_txt}>{props.profile.lookingForAJobDescription}</span> </div>
                <div>My contacts</div>
            </div>
        </div>
    );
}
export default ProfileInfo;
